import React from "react";
export default function Question(props){
    console.log(props)
    console.log(props.questionData)

    const wrongAnswers = props.questionData.incorrectAnswers.map(
        (a) => 
        <input
        type="radio"
        value="incorrect">{a}</input>
        )
    return(
        <section>
        <h2>HELLO {props.questionData.question}</h2>
        {//
        }
       {wrongAnswers}
        </section>
    )
}
